import React from "react";

function PreparedBySelector({ value, setValue }) {
  const handleSelect = (selectedValue) => {
    setValue(selectedValue);
  };

  return (
    <div className="selector-container">
      <label className="selector-label">Prepared By</label>
      <button
        onClick={() => handleSelect("Eos Lightmedia")}
        className={value === "Eos Lightmedia" ? "selected" : ""}
      >
        Eos Lightmedia
      </button>
      <button
        onClick={() => handleSelect("Abernathy Lighting Design")}
        className={value === "Abernathy Lighting Design" ? "selected" : ""}
      >
        Abernathy Lighting Design
      </button>
    </div>
  );
}

export default PreparedBySelector;
